import React, { useState, useEffect } from 'react';
import "./styles/Timer.css"

export default function Timer( {isOpen}) {
    const [time, setTime] = useState(0);

    useEffect(() => {
        const intervalId = setInterval(() => {
            setTime(prevTime => prevTime + 10); 
        }, 10); 

        return () => clearInterval(intervalId); // Städa upp intervallet när komponenten avmonteras
    }, []);

    // Beräkna minuter, sekunder och hundradelar av sekunder
    const minutes = Math.floor(time / (60 * 100));
    const seconds = Math.floor((time % (60 * 100)) / 100);
    const milliseconds = time % 100;

    // Formatera tiden med två siffror (t.ex. 09 istället för 9)
    const formattedTime = `${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')}:${milliseconds.toString().padStart(2, '0')}`;


  return (
    <div className="home-wrapper" style={{ filter: isOpen ? "blur(4px) brightness(40%)" : "blur(0) brightness(100%)" }}>
        <h2>Timer</h2>

        <div className="timer">

            <h1></h1>
        </div>
        </div>
  )
}
